import React from "react";
import GridLayout from "react-grid-layout";
import "react-grid-layout/css/styles.css";
import "react-resizable/css/styles.css";

export const GridItem = ({ key, title, text, layout }) => {
  return (
    <div key="b" className="bg-white border border-gray-300 flex items-center justify-center text-lg">
      <span className="draggable-handle cursor-move p-2">B</span>
    </div>
  );
};

export const GridItemWithImage = ({ key, title, text, image, alt }) => {
  return (
    <div key={key} className="react-grid-item bg-white border border-gray-300 flex items-center justify-center text-lg draggable-handle cursor-pointer">
      <img src={image} alt={alt} className="mb-2" />
      <h5>{title}</h5>
      <span className="p-2">{text}</span>
    </div>
  );
};
